import React from 'react';
import { Link } from 'react-router-dom';
import './Header.scss';


export const Header = () => {
    return (
      <header className='header'>
        <ul className='header__menu'>
          <li className="header__menu-link">
            <Link className="header__menu-link-item" to='/'>Home</Link>
          </li>
          <li>
            <Link className="header__menu-link-item" to='/blog'>Blog</Link>
          </li>
          <li>
            <Link className="header__menu-link-item" to='/contact'>Contact</Link>
          </li>
        </ul>
      </header>
    );
  };
